import React from 'react';

const HomePage = () => {
  return (
    <div className="flex   h-screen bg-gradient-to-r from-blue-500 to-indigo-600 text-white  p-6">
      <h1 className="text-4xl md:text-6xl font-bold mb-4">Welcome to Our Solution</h1>
      <p className="text-lg md:text-xl mb-6">Empowering your journey with cutting-edge technology and innovative tools.</p>
      <button className="bg-white text-blue-600 px-6 py-3 rounded-full font-semibold shadow-md hover:bg-gray-100 transition duration-300">Get Started</button>
    </div>
  );
};

export default HomePage;
